import React, { useState } from 'react';
import { Link, NavLink  } from "react-router-dom";
import './Navbarinside.css';
import {FaBars} from 'react-icons/fa';
import AccountBoxIcon from '@mui/icons-material/AccountBox';

import NotificationsIcon from '@mui/icons-material/Notifications';

const Navbarinside = () => {
  function myFunction() {
    var x = document.getElementById("myTopnav");
    if (x.className === "icon-bar") {
      x.className += " responsive";
    } else {
      x.className = "i";
    }
  }
  return (
  
    <div className="icon-bar" id="myTopnav">
      <a href='' className='leftsidenav' style={{float:'left'}}>home</a>
      <a href='' className='leftsidenav' style={{float:'left'}}>available donors</a>
      <a href='' className='leftsidenav' style={{float:'left'}}> donor center location</a>
      <a href='' className='leftsidenav' style={{float:'left'}}><NotificationsIcon/>private blood request</a>
    
    <a href=""><AccountBoxIcon /></a> 
  </div>

        );
      }
  

export default Navbarinside;
